import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Inicio from './Pages/Inicio';

function AppRoutes() {
    return(
        <BrowserRouter>
            <Routes>
                <Route
                    path="/"
                    element={<Inicio/>}>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default AppRoutes;
